#import "Fundfixed+Fundfixed2Dictionary.h"

@implementation Fundfixed (Fundfixed2Dictionary)

-(NSDictionary*)dictionary:(NSMutableDictionary*)dic
{
    if (nil == dic) {
        return dic;
    }
    
    if ([self hasCode]) {
        [dic setObject:code forKey:@"jjdm"];
    }
    
    if ([self hasDthb1N]) {
        [dic setObject:dthb1N forKey:@"dthb1n"];
    }
    
    if ([self hasDthb2N]) {
        [dic setObject:dthb2N forKey:@"dthb2n"];
    }
    
    if ([self hasDthb3N]) {
        [dic setObject:dthb3N forKey:@"dthb3n"];
    }
    
    if ([self hasDthb4N]) {
        [dic setObject:dthb4N forKey:@"dthb4n"];
    }
    
    if ([self hasDthb5N]) {
        [dic setObject:dthb5N forKey:@"dthb5n"];
    }
    
    if ([self hasJjjz]) {
        [dic setObject:jjjz forKey:@"jjjz"];
    }
    
    if ([self hasLjjz]) {
        [dic setObject:ljjz forKey:@"ljjz"];
    }
    
    if ([self hasJzrq]) {
        [dic setObject:jzrq forKey:@"jzrq"];
    }
    
    return dic;
}

@end
